import { AppBar, Toolbar, Typography } from "@material-ui/core";

const Header = () => {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="caption">This is the header</Typography>
      </Toolbar>
    </AppBar>
  );
};
export default Header;
